import React, { useState, useEffect } from "react";
import "./App.css";
import { BrowserRouter as Router } from "react-router-dom";
import Loading from "./components/Preloader/Loading";
import axios from "axios";
import Sidebar from "./components/Sidebar";
import Navbar from "./components/Navbar";
import Pageone from "./components/Pageone/Pageone";

function App() {
  const [loading, setloading] = useState(false);
  const [Post, setPost] = useState([]);
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => {
    setIsOpen(!isOpen);
  };

  useEffect(() => {
    setloading(true);
    setTimeout(() => {
      setloading(false);
    }, 0);
  }, []);

  useEffect(() => {
    axios
      .get(
        "https://api.nasa.gov/mars-photos/api/v1/rovers/curiosity/photos?earth_date=2015-6-3&api_key=C0AhMKBPXqpPU9pZrHZjgu5oTmINIkBrrdHwNL2T"
      )
      .then((res) => {
        setPost(res.data.collection.items);
        console.log(res.data);
      })
      .catch((error) => console.log(error));
  }, []);

  const { sool } = Post;

  return (
    <Router>
      <>
        {loading ? (
          <>
            <Loading />
          </>
        ) : (
          <>
            <Sidebar isOpen={isOpen} toggle={toggle} />
            <Navbar toggle={toggle} />
            <div style={{ margin: "15vh", height: "5vh" }}>
              <h1 style={{ fontSize: "20px" }}>{sool}</h1>
            </div>
            <Pageone />
          </>
        )}
      </>
    </Router>
  );
}

export default App;
